import React, { Component } from 'react';
import Home from './Home';
import Header from "./Header";
import Footer from "./Footer";
import Slidebar from "./Slidebar";
import {Packages} from "../shared/packages";
import PackageInfo from "./PackageInfo";




class Main extends Component {
    constructor(props){
       super(props);
       this.state = {
          packages: Packages,
          selectedPackage: null  
        }
    }   
    render(){
        return(
            <React.Fragment>

                <Header />
                <Slidebar />
                <Home />
                <Directory packages={this.state.packages} onClick={packageId => this.onCampsiteSelect(packageId)}/>
                {/* <PackageInfo package={this.state.packages.filter(package => package.id === this.state.selectedPackage)[0]} /> */}
                <Footer />
           </React.Fragment>
        );
    }
}
export default Main;
